import React from "react";

import "./SkillItem.css";

const SkillItem = props => {
  let starRating = "⭐".repeat(props.level);
  let filler = "⚝".repeat(5 - props.level);

  return (
    <div className="skillItem__wrapper">
      <p>{props.skill}</p>
      <p>
        {starRating}
        {filler}
      </p>
    </div>
  );
};

export default SkillItem;

